import React, { Component } from 'react'
import Header from './Header'
import Sidebar from './Sidebar'
import './sass/style.scss'


class App extends Component {
  render() {
    return (
    <div className="App">
    <Header />
    <Sidebar />

    <main className="main">
      <div className="container">
          <p className="main__description"></p>
          <p className="main__description"></p>
          <p className="main__description"></p>

      </div>
    </main>
    </div>
    )
  }
}

export default App;
